                        var charToUse = "";
                        var n = ascii.length;
                        var r = 256 / n;

                        charToUse = ascii[Math.min(n - 1, Math.max(0, n - Math.round(lum / r) - 1))];

                        if (data[i + 3] < 100) {
                            charToUse = ascii[0];
                        }
                        nCtx.fillText(charToUse, ((i % w) / 4) * size + (size / 2), (Math.floor(i / w)) * size + (size / 2));
                    }

                    v.src = nCanvas.toDataURL();
                } catch (ex) { }
            });
